import React from 'react'

function ProjectList({image,name}) {
  return (
    <div className='projectItem'>
        <div style={{backgroundImage:`url(${image})`}} className="bgImage" />
        <h1>{name}</h1>
        ProjectList</div>
  )
}

export default ProjectList
